void cap_dpp_csr_t::all(const cpp_int & in_val) {
    cpp_int _val = in_val;

    base.all( _val);
    _val = _val >> base.get_width(); 
    cfg_global.all( _val);
    _val = _val >> cfg_global.get_width(); 
    cfg_global_hw.all( _val);
    _val = _val >> cfg_global_hw.get_width(); 
    cfg_global_1.all( _val);
    _val = _val >> cfg_global_1.get_width(); 
    cfg_global_hw_1.all( _val);
    _val = _val >> cfg_global_hw_1.get_width(); 
    cfg_global_2.all( _val);
    _val = _val >> cfg_global_2.get_width(); 
    cfg_global_err_code.all( _val);
    _val = _val >> cfg_global_err_code.get_width(); 
    cfg_error_mask.all( _val);
    _val = _val >> cfg_error_mask.get_width(); 
    cfg_error_spare_mask.all( _val);
    _val = _val >> cfg_error_spare_mask.get_width(); 
    cfg_interrupt_mask.all( _val);
    _val = _val >> cfg_interrupt_mask.get_width(); 
    cfg_interrupt_spare_mask.all( _val);
    _val = _val >> cfg_interrupt_spare_mask.get_width(); 
    cfg_ohi_payload.all( _val);
    _val = _val >> cfg_ohi_payload.get_width(); 
    csr_intr.all( _val);
    _val = _val >> csr_intr.get_width(); 
    #if 32 > CAP_CSR_LARGE_ARRAY_THRESHOLD
    PLOG_ERR("all function for large_array not implemented" << endl);
    #else
    // cfg_spare_csr
    for(int ii = 0; ii < 32; ii++) {
        cfg_spare_csr[ii].all(_val);
        _val = _val >> cfg_spare_csr[ii].get_width();
    }
    #endif
    
    cfw_dpp_spare.all( _val);
    _val = _val >> cfw_dpp_spare.get_width(); 
    hdr.all( _val);
    _val = _val >> hdr.get_width(); 
    hdrfld.all( _val);
    _val = _val >> hdrfld.get_width(); 
    csum.all( _val);
    _val = _val >> csum.get_width(); 
    stats.all( _val);
    _val = _val >> stats.get_width(); 
    mem.all( _val);
    _val = _val >> mem.get_width(); 
    int_srams_ecc.all( _val);
    _val = _val >> int_srams_ecc.get_width(); 
    int_groups.all( _val);
    _val = _val >> int_groups.get_width(); 
    int_reg1.all( _val);
    _val = _val >> int_reg1.get_width(); 
    int_reg2.all( _val);
    _val = _val >> int_reg2.get_width(); 
    int_fifo.all( _val);
    _val = _val >> int_fifo.get_width(); 
    int_credit.all( _val);
    _val = _val >> int_credit.get_width(); 
    int_spare.all( _val);
    _val = _val >> int_spare.get_width(); 
}

cpp_int cap_dpp_csr_t::all() const {
    cpp_int ret_val;

    ret_val = ret_val << int_spare.get_width(); ret_val = ret_val  | int_spare.all(); 
    ret_val = ret_val << int_credit.get_width(); ret_val = ret_val  | int_credit.all(); 
    ret_val = ret_val << int_fifo.get_width(); ret_val = ret_val  | int_fifo.all(); 
    ret_val = ret_val << int_reg2.get_width(); ret_val = ret_val  | int_reg2.all(); 
    ret_val = ret_val << int_reg1.get_width(); ret_val = ret_val  | int_reg1.all(); 
    ret_val = ret_val << int_groups.get_width(); ret_val = ret_val  | int_groups.all(); 
    ret_val = ret_val << int_srams_ecc.get_width(); ret_val = ret_val  | int_srams_ecc.all(); 
    ret_val = ret_val << mem.get_width(); ret_val = ret_val  | mem.all(); 
    ret_val = ret_val << stats.get_width(); ret_val = ret_val  | stats.all(); 
    ret_val = ret_val << csum.get_width(); ret_val = ret_val  | csum.all(); 
    ret_val = ret_val << hdrfld.get_width(); ret_val = ret_val  | hdrfld.all(); 
    ret_val = ret_val << hdr.get_width(); ret_val = ret_val  | hdr.all(); 
    ret_val = ret_val << cfw_dpp_spare.get_width(); ret_val = ret_val  | cfw_dpp_spare.all(); 
    #if 32 > CAP_CSR_LARGE_ARRAY_THRESHOLD
    PLOG_ERR("all function for large_array not implemented" << endl);
    #else
    // cfg_spare_csr
    for(int ii = 32-1; ii >= 0; ii--) {
         ret_val = ret_val << cfg_spare_csr[ii].get_width(); ret_val = ret_val  | cfg_spare_csr[ii].all(); 
    }
    #endif
    
    ret_val = ret_val << csr_intr.get_width(); ret_val = ret_val  | csr_intr.all(); 
    ret_val = ret_val << cfg_ohi_payload.get_width(); ret_val = ret_val  | cfg_ohi_payload.all(); 
    ret_val = ret_val << cfg_interrupt_spare_mask.get_width(); ret_val = ret_val  | cfg_interrupt_spare_mask.all(); 
    ret_val = ret_val << cfg_interrupt_mask.get_width(); ret_val = ret_val  | cfg_interrupt_mask.all(); 
    ret_val = ret_val << cfg_error_spare_mask.get_width(); ret_val = ret_val  | cfg_error_spare_mask.all(); 
    ret_val = ret_val << cfg_error_mask.get_width(); ret_val = ret_val  | cfg_error_mask.all(); 
    ret_val = ret_val << cfg_global_err_code.get_width(); ret_val = ret_val  | cfg_global_err_code.all(); 
    ret_val = ret_val << cfg_global_2.get_width(); ret_val = ret_val  | cfg_global_2.all(); 
    ret_val = ret_val << cfg_global_hw_1.get_width(); ret_val = ret_val  | cfg_global_hw_1.all(); 
    ret_val = ret_val << cfg_global_1.get_width(); ret_val = ret_val  | cfg_global_1.all(); 
    ret_val = ret_val << cfg_global_hw.get_width(); ret_val = ret_val  | cfg_global_hw.all(); 
    ret_val = ret_val << cfg_global.get_width(); ret_val = ret_val  | cfg_global.all(); 
    ret_val = ret_val << base.get_width(); ret_val = ret_val  | base.all(); 
    return ret_val;
}

